  `billstate` varchar(40) CHARACTER SET latin1 DEFAULT NULL,
  `billzip` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `billcountry` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `businessacct` enum('No','Yes') CHARACTER SET latin1 DEFAULT NULL,
  `billbusiness` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `billmethod` enum('CC','ECHECK','PAYPAL','LEDGER') CHARACTER SET latin1 DEFAULT NULL,
  `ccnumber` varchar(40) CHARACTER SET latin1 DEFAULT NULL,
  `ccexp` varchar(4) CHARACTER SET latin1 DEFAULT NULL,
  `ccid` varchar(4) CHARACTER SET latin1 DEFAULT NULL,
  `bankname` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `acctype` enum('CK','SA') CHARACTER SET latin1 DEFAULT 'CK',
  `aba` varchar(9) CHARACTER SET latin1 DEFAULT NULL,
  `bankacctnum` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `dlnum` varchar(40) CHARACTER SET latin1 DEFAULT NULL,
  `dlstate` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `ssn` varchar(40) CHARACTER SET latin1 DEFAULT NULL,
  `invoice` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `authcode` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
  `refnum` varchar(42) CHARACTER SET latin1 DEFAULT NULL,
  `amount` decimal(12,2) DEFAULT NULL,
  `itemid` int(10) unsigned DEFAULT NULL,
  `description` varchar(2000) CHARACTER SET latin1 DEFAULT NULL,
  `transactiondate` datetime DEFAULT NULL,
  `ip` varchar(15) CHARACTER SET latin1 DEFAULT NULL,
  `merchaccount` varchar(25) CHARACTER SET latin1 DEFAULT NULL,
  `credited` varchar(30) CHARACTER SET latin1 DEFAULT NULL,
  `status` varchar(30) CHARACTER SET latin1 DEFAULT NULL,
  `email` varchar(100) CHARACTER SET latin1 DEFAULT NULL,
  `error` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `reconid` varchar(60) CHARACTER SET latin1 DEFAULT NULL,
  `requesttoken` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `trackid` varchar(87) CHARACTER SET latin1 DEFAULT NULL,
  `billdate` tinyint(3) unsigned DEFAULT NULL,
  `type` enum('sub','campaign','lead','domain','product','textcr') CHARACTER SET latin1 DEFAULT NULL,
  `inclsetupfee` tinyint(3) unsigned DEFAULT NULL,
  `inclannualfee` tinyint(3) unsigned NOT NULL DEFAULT 0,
  `new` tinyint(3) unsigned NOT NULL DEFAULT 0,
  `shipfname` varchar(50) CHARACTER SET latin1 DEFAULT NULL,
